import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Button, Alert, Breadcrumb, Card, Image } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

import honoluluImage from './images/honolulu.jpeg';
import jbchusalogo from './images/jbchusa-logo.png';

import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';
import * as Icon from 'react-bootstrap-icons';


function NavBar() {
  return (
    <div> 
    <Navbar bg="dark" variant="dark" expand="lg" >
      <Container>
        {/* <Navbar.Brand href="/">Jesus Baptist Hawaii Church</Navbar.Brand> */}
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mx-auto"> {/* Center the image */}
            <Image src={jbchusalogo} alt="Honolulu" fluid style={{ width: '50%', height: 'auto' }} />
          </Nav>
          <Nav className="ms-auto" style={{fontSize:"20px"}}> {/* Align NavLinks to the right */}
            <Nav.Link href="/"> Home</Nav.Link>
            <Nav.Link href="/sermon"> Sermon </Nav.Link>
            <Nav.Link href="/fellowship"> Fellowship </Nav.Link>
            <Nav.Link href="/contact"> Contact </Nav.Link>
            <NavDropdown title="Our Mission" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">USA Conference</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Life World Mission</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </div>
  );
}

const bodyStyle = {
  position: 'relative',
  width: '100%',
  height: 'auto',
};

const textStyle = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  textAlign: 'center',
  color: 'white',
};

function Body() {
  return (
    <div style={bodyStyle}>
      <Image src={honoluluImage} alt="Honolulu" fluid style={{ width: '100%', height: 'auto' }} />
      <div style={textStyle}>
        <h1 style={{ fontSize: '4.5rem' }}>Come and see.</h1>
        <h3 style={{ fontSize: '2.0rem' }}>John 1:46</h3>
        <div>
        <Button variant="primary" size="sm">
          Plan a Visit
        </Button>{' '}
        <Button variant="secondary" size="sm">
          Watch Live
        </Button>
      </div>
      </div>
    </div>
  );
}


function App() {
  return (
    <div style={{ position: 'relative' }}>
      <NavBar/>
      <Body />
    </div>
  );
}

export default App;
